using System;
using System.Collections.Generic;
using System.Linq;
using System.Reflection;
using System.Text;
using System.Threading.Tasks;

namespace HelpdeskDAL
{
     public class DALUtil
    {
        Dictionary<string, string> DictionaryEmployees;
        HelpdeskContext ctx;

        public DALUtil()
        {
            ctx = new HelpdeskContext();
        }

        public bool AddEmployeePicsToDb()
        {
            bool picsLoaded = false;
            try
            {

                LoadPicsInDictionary();

                foreach (Employee employee in ctx.Employees)
                {
                    employee.StaffPicture = Convert.FromBase64String(GetABase64Pic(employee.LastName));
                }
                ctx.SaveChanges();
                picsLoaded = true;
            }
            catch (Exception ex)
            {
                Console.WriteLine("Problem in " + MethodBase.GetCurrentMethod().Name + ex.Message);
            }
            return picsLoaded;
        }

        private string GetABase64Pic(string name)
        {
            string retval = "";
            foreach (System.Collections.Generic.KeyValuePair<string, string> pic in DictionaryEmployees)
            {
                if (pic.Key == name)
                    retval = pic.Value;
            }
            return retval;
        }

        private void LoadPicsInDictionary()
        {
            DictionaryEmployees = new Dictionary<string, string>();
            DictionaryEmployees.Add("Smartypants", "");
            DictionaryEmployees.Add("Pincher", "");
            DictionaryEmployees.Add("Andmirrors", "");
            DictionaryEmployees.Add("Slick", "");
            DictionaryEmployees.Add("Joe", "");
            DictionaryEmployees.Add("Beans", "");
            DictionaryEmployees.Add("Burner", "");
            DictionaryEmployees.Add("Dish", "");
            DictionaryEmployees.Add("Glow", "");
            DictionaryEmployees.Add("Span", "");
        }
    }
}

